  name: "brian",
  age: 30,
  email: "brian@toimc.com",
};

const run = async () => {
  const data = new User(user);

  const result = await data.save();
  // console.log(result);
};
// run();
// 查
const findMethods = async () => {
  const result = await User.find();
  // console.log(result);
};
findMethods();
